releases/0/tender/description:
Derby Homes manage and maintain Derby City Council’s buildings and we employ over 300 companies to achieve this. These companies deal with all many areas individual building trades work, supplies and services.
•Have you ever considered bidding for local authority contracts but don’t know how?
Derby Homes are holding an Open Day at 839 London Road, Derby, DE24 8UZ between 7am and 4pm on 3rd November 2016 to explain more about this. Our aim is to:
•inform you how to bid;
•show you where to look for opportunities;
•explain when the tender opportunities that you are interested in will next be available;
•advise you what you need to do in order to prepare for the opportunity;
There will also be representatives from the procurement teams at both Derby City Council and Efficiency East Midlands who will be on hand to discuss their opportunities and requirements.
Please come and talk with us. You can call in at any time between 7am and 4pm.
